INSERT INTO `tbl_aboutus` (`id`, `title`, `image`, `desc_sort`, `content`, `update_at`) VALUES
(1, 'Địa ốc Thiên Phú', '1658674230-van-phong.jpg', '<h5 style=\"text-align:center\"><img alt=\"\" src=\"http://dev.phuonghung.abc/public/uploads/files/gia-tri-cot-loi.jpg\" />C&ocirc;ng ty Cổ phần địa ốc Thi&ecirc;n Ph&uacute; được th&agrave;nh lập bởi c&aacute;c th&agrave;nh vi&ecirc;n nhiều kinh nghiệm v&agrave; t&acirc;m huyết trong lĩnh vực quy hoạch,đầu tư v&agrave; kinh doanh c&aacute;c dự &aacute;n bất động sản.</h5>\r\n\r\n<h5>C&ocirc;ng ty đ&atilde; v&agrave; đang ph&aacute;t triển theo định hướng kinh doanh đa dạng lĩnh vực trong ng&agrave;nh địa ốc: Đầu tư x&acirc;y dựng c&aacute;c dự &aacute;n căn hộ, chung cư cao cấp; kinh doanh bất động sản theo chuỗi dự &aacute;n v&agrave; đất nền trung khu&hellip; trong đ&oacute; kinh doanh bất động sản l&agrave; dịch vụ &ldquo;l&otilde;i&rdquo; của Thi&ecirc;n Ph&uacute;.</h5>\r\n\r\n<h5>Từ khi th&agrave;nh lập, Thi&ecirc;n Ph&uacute; lu&ocirc;n x&aacute;c định mục ti&ecirc;u của m&igrave;nh l&agrave; &ldquo;An cư lạc nghiệp&rdquo; v&agrave; phấn đấu trở th&agrave;nh một trong những c&ocirc;ng ty h&agrave;ng đầu, chuy&ecirc;n nghiệp v&agrave; ph&aacute;t triển trong lĩnh vực kinh doanh bất động sản.</h5>', '<div class=\"col large-12\" id=\"content\">\r\n<h1 style=\"text-align:center\">Giới Thiệu</h1>\r\n\r\n<p style=\"margin-left:80px\">C&Ocirc;NG TY CỔ PHẦN ĐỊA ỐC HAPHA được th&agrave;nh lập bởi c&aacute;c th&agrave;nh vi&ecirc;n nhiều kinh nghiệm v&agrave; t&acirc;m huyết trong lĩnh vực quy hoạch,đầu tư v&agrave; kinh doanh c&aacute;c dự &aacute;n bất động sản.</p>\r\n\r\n<p style=\"margin-left:80px\">C&ocirc;ng ty đ&atilde; v&agrave; đang ph&aacute;t triển theo định hướng kinh doanh đa dạng lĩnh vực trong ng&agrave;nh địa ốc: Đầu tư x&acirc;y dựng c&aacute;c dự &aacute;n căn hộ, chung cư cao cấp; kinh doanh bất động sản theo chuỗi dự &aacute;n v&agrave; đất nền trung khu&hellip; trong đ&oacute; kinh doanh bất động sản l&agrave; dịch vụ &ldquo;l&otilde;i&rdquo; của HAPHA.</p>\r\n\r\n<p style=\"margin-left:80px\">Từ khi th&agrave;nh lập, HAPHA lu&ocirc;n x&aacute;c định mục ti&ecirc;u của m&igrave;nh l&agrave; &ldquo;An cư lạc nghiệp&rdquo; v&agrave; phấn đấu trở th&agrave;nh một trong những c&ocirc;ng ty h&agrave;ng đầu, chuy&ecirc;n nghiệp v&agrave; ph&aacute;t triển trong lĩnh vực kinh doanh bất động sản.</p>\r\n\r\n<h2 style=\"margin-left:80px\"><img src=\"http://dev.phuonghung.abc/public/uploads/files/image-20220724225110-1.png\" style=\"height:538px; width:1341px\" /><img src=\"http://dev.phuonghung.abc/public/uploads/files/image-20220724225248-4.png\" style=\"height:499px; width:1416px\" /></h2>\r\n\r\n<h2 style=\"margin-left:80px\"><img src=\"http://dev.phuonghung.abc/public/uploads/files/image-20220724225324-5.png\" style=\"height:504px; width:1365px\" /></h2>\r\n\r\n<h1 style=\"text-align:center\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align:center\">CƠ CẤU TỔ CHỨC</h1>\r\n\r\n<p><img alt=\"\" src=\"http://dev.phuonghung.abc/public/uploads/files/struc.jpg\" style=\"height:800px; width:800px\" /></p>\r\n\r\n<h1 style=\"text-align:center\">VĂN PH&Ograve;NG</h1>\r\n\r\n<p><img alt=\"\" src=\"http://dev.phuonghung.abc/public/uploads/files/vp1(1).jpg\" style=\"height:709px; width:1400px\" /></p>\r\n\r\n<h3 style=\"text-align:center\"><span style=\"font-size:15pt\"><span style=\"font-family:Arial\"><span style=\"color:#555555\"><strong>HỒ CH&Iacute; MINH</strong></span></span></span></h3>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">S&ocirc; 344 Đường 30/4, Khu Phố 1, Phường 3, TP.T&acirc;y Ninh</span></span></span></p>\r\n\r\n<h6 style=\"text-align:center\"><span style=\"font-size:10pt\"><span style=\"font-family:Arial\"><span style=\"color:#555555\"><strong>LI&Ecirc;N HỆ</strong></span></span></span></h6>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">02766 525 525</span></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#333333\">info.thienphutayninh@gmail.com</span></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>&nbsp;</h3>\r\n</div>', '2022-07-24');
